disableMultiFactorUserMsg:"Etes-vous s\u00fbr de vouloir d\u00e9sactiver l'authentification multifacteur pour le membre ${user} ? Cette op\u00e9ration supprimera le niveau de s\u00e9curit\u00e9 renforc\u00e9 dont ce membre b\u00e9n\u00e9ficie actuellement.",errorDisableMultiFactor:"Un probl\u00e8me est survenu lors de la tentative de d\u00e9sactivation de l'authentification multifacteur pour ${user}.",disableMultiFactorSuccess:"L'authentification multifacteur a \u00e9t\u00e9 d\u00e9sactiv\u00e9e pour ${user}.",
