pwdPolicySetting:"Strat\u00e9gie de mot de passe",pwdPolicyDesc:"Vous pouvez d\u00e9finir la strat\u00e9gie de mot de passe pour tous les membres dot\u00e9s de comptes ArcGIS dans votre organisation afin d'\u00e9tablir des r\u00e8gles d\u00e9terminant le format de mot de passe autoris\u00e9. En outre, vous pouvez d\u00e9finir la dur\u00e9e des mots de passe et pr\u00e9ciser le nombre de mots de passe d\u00e9j\u00e0 saisis \u00e0 m\u00e9moriser auxquels comparer le nouveau mot de passe qui est entr\u00e9 afin d'\u00e9viter les doublons.",
pwdPolicyPortalDesc:"Vous pouvez d\u00e9finir la strat\u00e9gie de mot de passe pour tous les membres dot\u00e9s de comptes int\u00e9gr\u00e9s sur votre portail afin d'\u00e9tablir des r\u00e8gles d\u00e9terminant le format de mot de passe autoris\u00e9. En outre, vous pouvez d\u00e9finir la dur\u00e9e des mots de passe et pr\u00e9ciser le nombre de mots de passe d\u00e9j\u00e0 saisis \u00e0 m\u00e9moriser auxquels comparer le nouveau mot de passe qui est entr\u00e9 afin d'\u00e9viter les doublons.",
